■商品紹介<br>S25シングル球/バルブ形式：P21W/口金：BA15s<br>色温度：6500Kクラス/全光束：400lm/電圧：DC12V/消費電力：5.2W <br><br>■使用上の注意<br>本品はバックランプ専用です。その他の用途で使用しないで下さい。<br>車種への適合は必ずカーメイト適合情報をご確認ください。<br>本品は12V自動車用S25S(シングル球)タイプの交換用バルブです。<br>端子形状が異なるため、アンバー球との互換性はありません。<br><br>本品は純正バルブより消費電力が少ないため、車種によっては球切れ<br>警告灯が点灯する場合があります。<br>本品を輸入車に取付けないでください。車両に不具合が発生する場合が<br>あります。<br>LEDの光は純正白熱球と比べて指向性が強いため、灯具によっては<br>取付け前後で光の見え方が異なる場合があります。<br>車両の電源電圧が不安定な場合、光がちらつくことがあります。<br><style type="text/css">
