ひとつのバルブがホワイトとオレンジに発光！！<br><br>バルブの交換で、カンタンにウインカーポジション化が可能です。<br>T20ウインカー球に使用すれば、通常時はホワイトに点灯し、ウインカー動作時のみアンバーに切り替わります。<br>キャンセラー内蔵なので、カンタンな配線で取り付けができます。<br>T20汎用ダブルソケットなので、自動車メーカー・車種型式によっては取付け不可の場合がございます。必要に応じてソケットのツメを削るなどの加工を行ってください。<br> バルブサイズを画像にてご確認いただき、ウインカーレンズ内に取付けスペースがあるかをご確認ください。<br><br><br>【仕様】<br>・12V専用<br>・T20ダブル 汎用ソケット<br>・ホワイト（白）LED30連/アンバー（橙）LED30連<br> ・バルブ・ソケット2個入り<br><br><br>★汎用品となりますので、適合情報や加工方法につきましてはお答えできません。<br>★お取付けできなかった場合の、キャンセル・返品をお受けできません。<br>★ハイフラ防止のためウインカー抵抗が別途必要です。<br>★【ホワイト】→【アンバー】→【ホワイト】で点灯する際は、ホワイト点灯に1～2秒ほどタイムラグが生じます。<style type="text/css">
